import React, { Component } from 'react';
import './App.css';
import MapContainer from './MapContainer';
import NameSearch from './NameSearch';
import Grid from '@material-ui/core/Grid';


export class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      toCoordinates: {},
      fromCoordinates: {}
    };
  }
  state = {
    toCoordinates: {},
    fromCoordinates: {}
  };

  setCoordinates = (coordinates, type) => {
    this.setState({
      [type]: coordinates
    }, () => {
      console.log(this.state.toCoordinates, this.state.fromCoordinates)
    })

  }
  render() {
    return (
      <div>
        <Grid container
          direction="row"
          justify="flex-start"
          alignItems="center">
          <Grid item xs>
            <NameSearch setCoordinates={(e) => this.setCoordinates(e, 'fromCoordinates')} type={'From'} />
            <NameSearch setCoordinates={(e) => this.setCoordinates(e, 'toCoordinates')} type={'To'} />
          </Grid>
          <Grid item xs>
            <MapContainer />
          </Grid>
        </Grid>


      </div>
    );

  }
}

export default App;
